import { StatusBar } from 'expo-status-bar';
import { StyleSheet, Text, View } from 'react-native';

export default function App() {
  return (
    <View style={styles.container}>
      <Text > Name: Muhammad Farooq Qasim </Text>
        <Image style = {{ position: 'relative', left: 0, Top: 0, height: 150, width: 150 } }
        source = { require('./assets/farooq.png') } /> 
        <Text > Registeration No: 19 - ARID - 1200 </Text>  
        <Text> S / O: Khalid Mehmood </Text> 
        <Text> Degree: BS - Software Eng </Text>  
      <StatusBar style="auto" />
    </View>
  );
}

const styles = StyleSheet.create({
  container: {
    flex: 1,
    backgroundColor: '#fff',
    alignItems: 'center',
    justifyContent: 'center',
  },
});
